            <div class="container-fluid">
                <div class="navbar-header">
                    <a class="navbar-brand" href="#">My App</a>
                </div>
                <ul class="nav navbar-nav">
                    <li class="active"><a href="#">Home</a></li>
                </ul>
            </div>
        </nav>
    )
}

Header.defaultProps={
    branding:PropTypes.string.isRequired
}

const headingStyle  =   {
    // color:'red',
    fontSize:'50px'
}

export default Header;
